import React, { Component } from 'react';

class Controller extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
          <button type="button" className="fas fa-plus">button</button>
        </div>
      </div>
    );
  }
}

export default Controller;
